450 :     boolean typeable = true;
451 : 
452 :     switch (n.getType()) {
453 :       case Token.NAME:
454 :         typeable = visitName(t, n, parent);
455 :         break;
456 : 
457 :       case Token.LP:
458 :         // If this is under a FUNCTION node, it is a parameter list and can be
459 :         // ignored here.
