461 :           ensureTyped(t, n, getJSType(n.getFirstChild()));
462 :         } else {
463 :           typeable = false;
464 :         }
465 :         break;
466 : 
467 :       case Token.COMMA:
468 :         ensureTyped(t, n, getJSType(n.getLastChild()));
469 :         break;
470 : 
471 :       case Token.TRUE:
472 :       case Token.FALSE:
473 :         ensureTyped(t, n, BOOLEAN_TYPE);
474 :         break;
475 : 
476 :       case Token.THIS:
477 :         ensureTyped(t, n, t.getScope().getTypeOfThis());
478 :         break;
479 : 
480 :       case Token.REF_SPECIAL:
481 :         ensureTyped(t, n);
482 :         break;
483 : 
484 :       case Token.GET_REF:
485 :         ensureTyped(t, n, getJSType(n.getFirstChild()));
486 :         break;
487 : 
488 :       case Token.NULL:
489 :         ensureTyped(t, n, NULL_TYPE);
490 :         break;
491 : 
492 :       case Token.NUMBER:
493 :         if (n.getParent().getType() != Token.OBJECTLIT) {
494 :           ensureTyped(t, n, NUMBER_TYPE);
495 :         } else {
496 :           typeable = false;
497 :         }
498 :         break;
499 : 
500 :       case Token.ARRAYLIT:
501 :         ensureTyped(t, n, ARRAY_TYPE);
502 :         break;
503 : 
504 :       case Token.STRING:
