506 :           ensureTyped(t, n, STRING_TYPE);
507 :         } else {
508 :           typeable = false;
509 :         }
510 :         break;
511 : 
512 :       case Token.REGEXP:
513 :         ensureTyped(t, n, REGEXP_TYPE);
514 :         break;
