556 :         break;
557 : 
558 :       case Token.NOT:
559 :         ensureTyped(t, n, BOOLEAN_TYPE);
560 :         break;
561 : 
562 :       case Token.VOID:
563 :         ensureTyped(t, n, VOID_TYPE);
