624 :       case Token.GT:
625 :       case Token.GE:
626 :         leftType = getJSType(n.getFirstChild());
627 :         rightType = getJSType(n.getLastChild());
628 :         if (rightType.isNumber()) {
629 :           validator.expectNumber(
630 :               t, n, leftType, "left side of numeric comparison");
631 :         } else if (leftType.isNumber()) {
632 :           validator.expectNumber(
633 :               t, n, rightType, "right side of numeric comparison");
634 :         } else if (leftType.matchesNumberContext() &&
635 :                    rightType.matchesNumberContext()) {
636 :           // OK.
637 :         } else {
638 :           // Whether the comparison is numeric will be determined at runtime
639 :           // each time the expression is evaluated. Regardless, both operands
640 :           // should match a string context.
641 :           String message = "left side of comparison";
642 :           validator.expectString(t, n, leftType, message);
643 :           validator.expectNotVoid(
644 :               t, n, leftType, message, getNativeType(STRING_TYPE));
645 :           message = "right side of comparison";
