659 :         validator.expectString(t, left, leftType, "left side of 'in'");
660 :         ensureTyped(t, n, BOOLEAN_TYPE);
661 :         break;
662 : 
663 :       case Token.INSTANCEOF:
664 :         left = n.getFirstChild();
665 :         right = n.getLastChild();
666 :         leftType = getJSType(left);
667 :         rightType = getJSType(right).restrictByNotNullOrUndefined();
668 : 
669 :         validator.expectAnyObject(
670 :             t, left, leftType, "deterministic instanceof yields false");
671 :         validator.expectActualObject(
672 :             t, right, rightType, "instanceof requires an object");
673 :         ensureTyped(t, n, BOOLEAN_TYPE);
674 :         break;
675 : 
676 :       case Token.ASSIGN:
677 :         visitAssign(t, n);
678 :         typeable = false;
679 :         break;
680 : 
681 :       case Token.ASSIGN_LSH:
682 :       case Token.ASSIGN_RSH:
683 :       case Token.ASSIGN_URSH:
684 :       case Token.ASSIGN_DIV:
685 :       case Token.ASSIGN_MOD:
686 :       case Token.ASSIGN_BITOR:
687 :       case Token.ASSIGN_BITXOR:
688 :       case Token.ASSIGN_BITAND:
689 :       case Token.ASSIGN_SUB:
690 :       case Token.ASSIGN_ADD:
691 :       case Token.ASSIGN_MUL:
692 :       case Token.LSH:
693 :       case Token.RSH:
694 :       case Token.URSH:
695 :       case Token.DIV:
696 :       case Token.MOD:
697 :       case Token.BITOR:
698 :       case Token.BITXOR:
699 :       case Token.BITAND:
700 :       case Token.SUB:
701 :       case Token.ADD:
702 :       case Token.MUL:
703 :         visitBinaryOperator(n.getType(), t, n);
704 :         break;
705 : 
706 :       case Token.DELPROP:
707 :         if (!isReference(n.getFirstChild())) {
708 :           report(t, n, BAD_DELETE);
709 :         }
710 :         ensureTyped(t, n, BOOLEAN_TYPE);
711 :         break;
712 : 
713 :       case Token.CASE:
714 :         JSType switchType = getJSType(parent.getFirstChild());
715 :         JSType caseType = getJSType(n.getFirstChild());
716 :         validator.expectSwitchMatchesCase(t, n, switchType, caseType);
717 :         typeable = false;
718 :         break;
719 : 
720 :       case Token.WITH: {
721 :         Node child = n.getFirstChild();
722 :         childType = getJSType(child);
723 :         validator.expectObject(
724 :             t, child, childType, "with requires an object");
725 :         typeable = false;
726 :         break;
727 :       }
728 : 
729 :       case Token.FUNCTION:
730 :         visitFunction(t, n);
731 :         break;
732 : 
733 :       // These nodes have no interesting type behavior.
734 :       case Token.LABEL:
735 :       case Token.LABEL_NAME:
736 :       case Token.SWITCH:
737 :       case Token.BREAK:
738 :       case Token.CATCH:
739 :       case Token.TRY:
740 :       case Token.SCRIPT:
741 :       case Token.EXPR_RESULT:
742 :       case Token.BLOCK:
743 :       case Token.EMPTY:
744 :       case Token.DEFAULT:
745 :       case Token.CONTINUE:
746 :       case Token.DEBUGGER:
747 :       case Token.THROW:
748 :         typeable = false;
749 :         break;
750 : 
751 :       // These nodes require data flow analysis.
752 :       case Token.DO:
753 :       case Token.FOR:
754 :       case Token.IF:
755 :       case Token.WHILE:
756 :         typeable = false;
757 :         break;
758 : 
759 :       // These nodes are typed during the type inference.
760 :       case Token.AND:
761 :       case Token.HOOK:
762 :       case Token.OBJECTLIT:
763 :       case Token.OR:
764 :         if (n.getJSType() != null) { // If we didn't run type inference.
765 :           ensureTyped(t, n);
766 :         } else {
767 :           // If this is an enum, then give that type to the objectlit as well.
768 :           if ((n.getType() == Token.OBJECTLIT)
769 :               && (parent.getJSType() instanceof EnumType)) {
770 :             ensureTyped(t, n, parent.getJSType());
771 :           } else {
772 :             ensureTyped(t, n);
773 :           }
774 :         }
775 :         break;
776 : 
777 :       default:
778 :         report(t, n, UNEXPECTED_TOKEN, Token.name(n.getType()));
779 :         ensureTyped(t, n);
780 :         break;
781 :     }
782 : 
783 :     // Don't count externs since the user's code may not even use that part.
784 :     typeable = typeable && !inExterns;
785 : 
786 :     if (typeable) {
787 :       doPercentTypedAccounting(t, n);
788 :     }
789 : 
790 :     checkNoTypeCheckSection(n, false);
791 :   }"

